            "projectDes": "金湖水库分洪工程项目建设区域位于深圳市福田区，影响范围包括罗湖区和福田区，分别是深圳市新老重点开发和建设的中心城区。本工程所涉及流域包括笔架山河流域和福田河流域。笔架山河与福田河都是深圳河的支流，其中笔架山河汇入布吉河后再汇入深圳河。\r\n根据工程设计方案，坂银通道主线在经过笔架山并跨过北环大道后，采用高架桥方式跨越金湖下库，然后采用隧道形式下穿金湖上库坝体，下沉穿越金湖上库后接入鸡公山。坂银通道的建设将占用现状金湖上库库容，对金湖上库的现状调蓄能力影响较大。若实施库容补偿工程后，金湖水库调度下泄流量仍增大，加重了下游笔架山河的行洪压力。而且，坂银通道工程施工期约为3年左右，长时段跨越汛期施工更加增大了金湖水库周边及笔架山河的防洪风险。根据相关城市总体规划、防洪潮排涝规划等需求，本项目拟通过分洪隧洞工程、库区防洪工程、福田河节制闸改造工程实现由金湖水库流域向福田河流域部分或全部分排洪水，减小坂银通道工程建设对水利设施的影响，保障罗湖中心区的城市防洪安全。\r\n本分洪隧洞工程全长1.942km；其中顶管段长126m，隧洞长约1.8km，隧洞过水断面为城门洞型，二衬完成后断面宽3m，分洪闸段。隧洞进口处在金湖上库用隧洞地下暗挖下穿金湖上库过金湖路至金湖下库，然后采用顶管方式地下穿过北环大道，之后再用隧洞地下暗挖穿过笔架山，最后隧洞出口连接福田河。",
